import React from 'react';

class FormData extends React.Component {
	
	constructor(props){
		super(props);
		console.log(props.formValues[0].title);

	}
  renderReview = () => {
    return props.formValues.map((val) => {
      return (
        <div>
          {val.title}:{val.value}
        </div>
      );
    });
  };
  
	handleSubmit = () => {
    alert("submitted");
  };
  
	render(){
		return (
			<div>
				<div>{this.renderReview()}</div>
				<div></div>
				<button onClick={props.onCancel}>Back</button>
				<button onClick={this.handleSubmit}>Send Survey</button>
			</div>
		);
	}

}
export default FormData;
